import { useEffect, useState } from "react";
import axios from "axios";

function UserList() {
  const [userName, setUserName] = useState("");
  const [userPic, setUserPic] = useState("");
  const [admin, setAdmin] = useState(false);
  useEffect(() => {
    let url = "/userinfo";
    const fetchData = async () => {
      const result = await axios.get(url);
      //유저 정보가 존재하지 않을경우 로그인 페이지
      if (
        result.data === "" ||
        result.data.userProfileId.userAccount === "" ||
        result.data.userProfileId.userAccount === undefined ||
        result.length === 0
      ) {
        navigate("/login");
      } else {
        setUserInfo(result);
        setUserPic(result.data.userProfilePicPath);
        setUserIsAdmin(result.data.userIsAdmin);

        console.log(result);
      }
    };
    fetchData();
  }, []);
  return (
    <div>
      <div className="set_admin_user_box">
        <img className="user_pic"></img>
        <div className="user_name"></div>
        <div className="user_is_admin_box">
          <input type="checkbox" />
          <label>관리자</label>
        </div>
      </div>
    </div>
  );
}
export default UserList;
